Grafmonument voor Schout bij Nacht W.J.G. Bentinck (1745-1781) die sneuvelde tijdens de Slag bij de Doggersbank, onthuld 1782 in de Nieuwe Kerk in Amsterdam, naar ontwerp van
          Anthony Ziesenis. 1 interieurprent: ets ets Recto l.o., m.o. en r.o., direct onder vrst.: 'A. Ziesenis inv et del.' en 'J. Allart excud.' en 'R. Vinkeles sculp. 1782.' blad 173 x 112mm.;
          vrst. 130 x 85 mm.

rdf:Description.dc:description:
Onderste helft van blad met twee prenten: de Eilandskerk op het Bickerseiland, gezien in noordwestelijke richting, met de Eilandsgracht links. De kerk werd in 1736 in
          gebruik genomen en in 1950 gesloopt. De bijbehorende bovenste afbeelding is die van de Oosterkerk. 1 topogr. prent op 1 blad: ets en gravure ets en enige gravure z.s. blad 124 x 150 mm.;
          vrst.: 75 x 100 mm.

De Oudeschans, gezien vanaf het 's-Gravenhekje in zuidelijke richting. In het midden de Montelbaanstoren en rechts daarvan de ingang van de Waalseilandsgracht. Midden geheel
          achter de toren van de Zuiderkerk. In het water enkele binnenschepen en roeiboten. 1 topografische prent: staalgravure staalgravure recto direct onder vrst. l.o. 'Drawn by Capn. Batty.';
          r.o. 'Engraved by Edwd. Goodall.' blad 191 x 277 mm.; vrst. 126 x 206 mm.

