De Oudeschans, gezien vanaf het 's-Gravenhekje in zuidelijke richting. In het midden de Montelbaanstoren en rechts daarvan de ingang van de Waalseilandsgracht. Midden geheel
          achter de toren van de Zuiderkerk. In het water enkele binnenschepen en roeiboten. 1 topografische prent: staalgravure staalgravure recto direct onder vrst. l.o. 'Drawn by Capn. Batty.';
          r.o. 'Engraved by Edwd. Goodall.' blad 191 x 277 mm.; vrst. 126 x 206 mm.

Gezicht over de Keizersgracht naar de Westermarkt, met Westerhal en Westerkerk. Links het hoekhuis Keizersgracht/Westermarkt en Keizersgracht 200. Op de voorgrond rechts worden
          tonnen in een tjalk geladen. 1 topografische prent: staalgravure staalgravure recto direct onder vrst. l.o. 'Drawn by Capt. Batty.'; r.o. 'Engraved by Robt. Wallis.' blad 190 x 278 mm.;
          vrst. 125 x 206 mm.

De Oudeschans, gezien in zuidelijke richting, met rechts de Montelbaanstoren en de ingang van de Waalseilandsgracht. Links op de voorgrond een zeilboot met kajuit, rechts een
          roeiboot of praam. 1 topogr. prent: staalgravure staalgravure direct onder vrst., l.o. en r.o. 'W. Cooke delt.' en 'Foltz sculpt.'; l.o. in vrst., op zeilboot 'F. Foltz' blad 123 x 134 mm.;
          vrst. ca. 110 x 120 mm.

Gezicht op de bloemen- en plantenmarkt op de Nieuwezijds Voorburgwal ten zuiden van de Wijdesteeg (thans: Postzegelmarkt). Links het hoekhuis Nieuwezijds Voorburgwal 262. Op de
          achtergrond de achtergevel van het Stadhuis. 1 topografsiche prent: ets ets recto l.o. en r.o. vrst. (stippelets) 'J. Cats delin.' en 'J.P. Visser Bender sculp.' blad ca. 304 x 333 mm.;
          plaat 120 x 138 mm.; vrst. 55 x 85 mm.

